import React, { Component } from 'react';

export default class BlindTimer extends Component {

    constructor(props) {
        super(props);
        this.state = {
            hidden: false,
        }

    }

    start() {
        const startTime = new Date();
        this.setState({ startTime });
    }

    stop() {
        const endTime = new Date();
        this.setState({ endTime });
    }

    reset() {
        this.setState({})
    }


    render() {
        return (
            <div></div>
        )
    }
}
